import Link from 'next/link'

const linkStyle = {
  marginRight: 15
}
const services_array = ["Prabhakar Mishra", "Solutions", "Projects", "Gear", "Music", "Contact"];
export default function Header() {
  return (
    <nav class="navbar">
      <div>
        {services_array.map(service => (
          <Link href={`/${(service).replace("Prabhakar Mishra", '')}`}>
            <button style={linkStyle}>
              <span>{service}</span>
            </button>
          </Link>
        ))}
      </div>
    </nav>
  )
}
